import React from "react";
import { Link } from "react-router-dom";

function RegionalOfficeCard(props) {
  const { id, regionalOfficeName, imageUrl } = props.regionalOffice;
  return (
    <div className="card shadow h-100">
      <img className="card-img-top" src={imageUrl} alt={regionalOfficeName} />
      <div className="card-body">
        <h4 className="card-title">{regionalOfficeName}</h4>
        <Link to={`/regionaloffice/${id}`} className="stretched-link"></Link>
      </div>
    </div>
  );
}

export default RegionalOfficeCard;
